ListingCategoriesPage:
fragment ListingCategoryRow on ListingCategory {
  id
  name
  path
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingCategoriesPage {
  listingCategories {
    entities {
      ...ListingCategoryRow
    }
    paging {
      ...Paging
    }
  }
}

ListingQueriesPage:
fragment ListingQueryRow on ListingQuery {
  id
  url
  searchParams
  config
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingQueriesPage {
  listingQueries {
    entities {
      ...ListingQueryRow
    }
    paging {
      ...Paging
    }
  }
}

ListingsPage:
fragment ListingRow on Listing {
  id
  title
  image
  condition
  price
  shippingPrice
  purchaseOptions
  location
  listingAt
  returns
  buyItNowPrice
  bidsCount
}

fragment Paging on Paging {
  page
  pageSize
  totalEntities
  totalPages
}


query ListingsPage {
  listings {
    entities {
      ...ListingRow
    }
    paging {
      ...Paging
    }
  }
}
